import SideToolBarButton1 from './SideToolBarButton1';
import SideToolBarButton2 from './SideToolBarButton2';
import SideToolBarButton3 from './SideToolBarButton3';



const SideToolBar=()=>{

return (

<div className={classes.sideToolBarDiv}>

<SideToolBarButton1/>

<SideToolBarButton2/>

